n        <!-- shortpoint-ko if: $root.ConnectBase.isConnected() && !_existInChild -->\r\n          <div class="sp-inserter-form-group" data-shortpoint-bind="template: { name: \'shortpoint-\' + type, data: $data }"></div>\r\n        <!-- /shortpoint-ko -->\r\n      <!-- /shortpoint-ko -->\r\n\r\n      <div class="sp-inserter-panel-default sp-inserter-panel" data-shortpoint-bind="visible: hasNestedItems">\r\n        <div class="sp-inserter-panel-heading">\r\n          <span data-shortpoint-bind="text: hasNestedItems ? nestedShortpoint.title : \'\'"></span> items\r\n          <span data-shortpoint-bind="text: nestedItems().length, visible: nestedItems().length && !$root.ConnectBase.isConnected()" class="sp-inserter-badge" style="display: none;">5</span>\r\n          <div class="sp-inserter-btn sp-inserter-btn-info sp-inserter-pull-right sp-inserter-btn-xs" data-shortpoint-bind="click: $parent.addNestedItem.bind( $parent ), visible: !$root.ConnectBase.isConnected()">Add</div>\r\n        </div>\r\n        <div class="sp-inserter-panel-body">\r\n          <div class="sp-inserter-alert sp-inserter-alert-warning" data-shortpoint-bind="visible: !nestedItems().length" role="alert" style="display: none;">\r\n            <strong>Warning!</strong> There are no nested items inside.\r\n          </div>\r\n          <!-- shortpoint-ko foreach: nestedItems -->\r\n          <div class="sp-inserter-panel-default" data-shortpoint-bind="css: { \'sp-inserter-panel\': !$root.ConnectBase.isConnected() }">\r\n            <div class="sp-inserter-panel-heading sp-inserter-clickable" data-shortpoint-bind="click: $parents[1].toggleNestedItem.bind( $parents[1] ), visible: !$root.ConnectBase.isConnected()" style="display: none;">\r\n              <i class="shortpoint-icon-fa-plus-square-o" data-shortpoint-bind="visible: !isExpanded()"></i>\r\n              <i class="shortpoint-icon-fa-minus-square-o" data-shortpoint-bind="visible: isExpanded()"></i>\r\n              <span data-shortpoint-bind="te